import React from 'react';
import {useState } from "react";
const UserList = ({users}) => {
    const [name, setname] = useState("k");
    console.log(users)
    return(
        
        <div>
            {users&&users.result.map((result) =>{
                <div key={result.contactName}>
                    response {result.contactResponse}
                </div>
            })}
        <div>
            {name}
        </div>
            
            
            

        </div>
        
    );
};

export default UserList;
